message: "Р—Р°РґРЅСЏСЏ СѓСЂРµС‚СЂР°   РџРѕСЃР»Рµ РёСЃСЃРµС‡РµРЅРёСЏ СЂСѓР±С†Р° Рё РїРѕРґРіРѕС‚РѕРІРєРё Рє РІСЃРєСЂС‹С‚РёСЋ  РїСЂРѕРєСЃРёРјР°Р»СЊРЅРѕРіРѕ РѕС‚РґРµР»Р° РјРѕС‡РµРёСЃРїСѓСЃРєР°С‚РµР»СЊРЅРѕРіРѕ РєР°РЅР°Р»Р° РїРµСЂРµРґРЅСЏСЏ СѓСЂРµС‚СЂР° РјРѕР±РёР»РёР·РёСЂСѓРµС‚СЃСЏ  РѕС‚ РєР°РІРµСЂРЅРѕР·РЅС‹С… С‚РµР» РґРѕ СѓСЂРѕРІРЅСЏ СЃСѓСЃРїРµРЅР·РѕСЂРЅС‹С… СЃРІСЏР·РѕРє РїРѕР»РѕРІРѕРіРѕ С‡Р»РµРЅР° - РЈСЂРѕР»РѕРіРёСЏ     https://urolog.com.ru/urologiya/povrezhdeniya-organov/povrezhdeniya-mocheispuskatelnogo-kanala.html -  РћРЅР° РїСЂРѕС…РѕРґРёС‚ РѕС‚ РџРѕРІСЂРµР¶РґРµРЅРёСЏ РјРѕС‡РµРёСЃРїСѓСЃРєР°С‚РµР»СЊРЅРѕРіРѕ РєР°РЅР°Р»Р°  РћРіСЂР°РЅРёС‡РµРЅРёСЏ РґР»СЏ С‚СЂР°РЅСЃСѓСЂРµС‚СЂР°Р»СЊРЅРѕР№ СЂРµР·РµРєС†РёРё РїСЂРµРґСЃС‚Р°С‚РµР»СЊРЅРѕР№ Р¶РµР»РµР·С‹ (РўРЈР\_РџР–) Сѓ РїР°С†РёРµРЅС‚РѕРІ РїРѕСЃР»Рµ СЂРµРєРѕРЅСЃС‚СЂСѓРєС†РёРё Р·Р°РґРЅРµР№ СѓСЂРµС‚СЂС‹"
